import sendGrid from "@sendgrid/mail";
sendGrid.setApiKey(process.env.SEND_GRID_API_KEY);

/**
 * endpoint: http://localhost:3000/api/sendgrid/confirmation
 */

export default async function confirmationEmail(req, res) {
  const { body: email } = req;
  const TEXT = `Witaj w newsletterze Pralmy
  
  Dziękujemy, że dołączyłeś do nas.

  Teraz na pewno nie przegapisz żadnej promocji, którą dla Ciebie przygotujemy.
  Masz teraz dostęp do najnowszych wiadomości o trendach, innowacjach i
  rozwiązaniach w branży przemysłowego wyposażenia pralni.

  Trochę informacji porządkowych.

  Jeśli nie otrzymujesz od nas wiadomości, sprawdź swój folder spamu. 
  I proszę oznaczyć ten adres jako "nie spam". Jeśli newslettera również nie ma w folderze spamu, 
  należy zajrzeć do zakładki Promocje.

  Jeszcze raz dziękujemy i prosimy o przekazanie informacji kilku znajomym, jeśli macie ochotę.

  Serdecznie pozdrawiamy,
  .P.U.P Pralma, Kielce
  `;

  const HTML = `
  <html>
    <head>
        <title>Witaj w newsletterze Pralmy</title>
    </head>
    <body style="width:480px;margin:0 auto; padding:32px;">
        <div style="">
            <img style="display:block;" width="96px" height="40px" alt="logo pralma" src="data:image/webp;base64,"/>       
        </div>
        <h3>Dziękujemy, że dołączyłeś do nas</h3>
        <p style="line-height:1.3;">
            Teraz na pewno nie przegapisz żadnej <strong>promocji</strong>, którą dla Ciebie przygotujemy.
            Masz też dostęp do najnowszych wiadomości o trendach, <b>innowacjach</b> i
            rozwiązaniach w branży przemysłowego wyposażenia pralni.
        </p>
        <h3>Trochę informacji porządkowych</h3>
        <p style="line-height:1.3;">
        Jeśli nie otrzymujesz od nas wiadomości, sprawdź swój folder spamu. 
        I proszę oznaczyć ten adres jako "nie spam". Jeśli newslettera również nie ma w folderze spamu, 
        należy zajrzeć do zakładki Promocje.
        </p>
        <em style="margin-bottom:16px;">Jeszcze raz dziękujemy i prosimy o przekazanie informacji kilku znajomym, jeśli masz ochotę.</em>
        <p>Serdecznie pozdrawiamy,</p>
        <div style="display:flex;flex-direction:column;">
            <strong style="margin-bottom:8px;">P.P.U.P Pralma, Kielce</strong>
            <div style="margin-bottom:8px;display:flex;align-items:center;"><span style="width:80px;display:block;font-size:14px;">email: </span><a style="color:#005c74; font-size:14px;" href="mailto:biuro@pralma.pl">biuro@pralma.pl</a></div>
            <div style="margin-bottom:8px;display:flex;align-items:center;"><span style="width:80px;display:block;font-size:14px;">tel./fax: </span><a style="color:#005c74; font-size:14px;" href="tel:+48413450561">+48 41 3450561</a></div>
            <div style="margin-bottom:8px;display:flex;align-items:center;"><span style="width:80px;display:block;font-size:14px;">www: </span><a style="color:#005c74; font-size:14px;" href="http://www.pralma.pl">www.pralma.pl</a></div>
        </div>
    </body>
  </html>
  `;

  const message = {
    to: email,
    from: {
      email: "k.wrona@pralma.pl",
      name: "P.P.U.P Pralma sp. z o.o., Kielce",
    },
    subject: "Witaj w newsletterze Pralmy 😃👋",
    text: TEXT,
    html: HTML,
  };
  try {
    await sendGrid.send(message);
    return res.status(200).json({ message: "Wysłano potwierdzenie zapisania na newsletter" });
  } catch (error) {
    if (error.code) {
      if (error.code === 403) {
        return res.status(403).json({
          message: "Odmowa spełnienia żądania wysłania potwierdzenia",
        });
      }
      if (error.code === 400) {
        return res.status(400).json({ message: "Niepoprawne żądanie" });
      }
      return res.status(401).json({
        message: `Wysłanie potwierdzenia nie powiodło się.`,
      });
    }
  }
}
